import React from 'react';
import { createRoot } from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom';
import App from './App';
import reportWebVitals from './reportWebVitals';
import Category from './post/PageCategory';


const rootContainer = document.getElementById('root');
if (rootContainer) {
  const root = createRoot(rootContainer);
  root.render(
      <BrowserRouter>
        <App/>
      </BrowserRouter>
  );
} 

const categoryContainer = document.getElementById('Box2');
if (categoryContainer) {
  const categoryRoot = createRoot(categoryContainer);
  categoryRoot.render(
      <BrowserRouter>
        <Category setSelectedCategory={() => {}}/>
      </BrowserRouter>
  );
} 

const frofileContainer = document.getElementById('profile');
if (frofileContainer) {
  const categoryRoot = createRoot(frofileContainer);
  categoryRoot.render(
      <BrowserRouter>
        <Profile/> 
      </BrowserRouter> 
  );
} 

reportWebVitals();
